import "../Shopper-Home/shopperHomeComponent.css"
import { Link, useNavigate, Routes, Route } from "react-router-dom";
import { useCookies, } from "react-cookie";
import { useEffect } from "react";
import ShopperCategotyComponent from "../Shopper-Category/shopperCategoryComponent.js";



function ShopperHomeComponent() {

    // eslint-disable-next-line no-unused-vars
    const [cookies, setCookie, removeCookie] = useCookies();
    const navigate = useNavigate();


    useEffect(() => {
        if (cookies["UserID"] === undefined) {
            navigate("/login");
        }
    },);

    function SignOutClick() {
        removeCookie("UserID");
        navigate("/login");
    }

    return (
        <div className="container-fluid">
            <div className="text-end">
                <h4>Hello...!  -  {cookies["UserID"]}</h4>
            </div>
            <div className="d-flex justify-content-between" >
                <div>
                    <Link to="category/electronics">
                        <img src="electronics.jpg" alt="electronics" />
                    </Link>
                </div>
                <div>
                    <Link to="category/men's clothing">
                        <img src="men's clothing.jpg" alt="men's clothing" />
                    </Link>
                </div>
                <div>
                    <Link to="category/women's clothing">
                        <img src="women's clothing.jpg" alt=" women's clothing" />
                    </Link>
                </div>
                <div>
                    <Link to="category/jewelery">
                        <img src="jewelery.jpg" alt="jewelery" />
                    </Link>

                </div>
            </div>
            <Routes>
            <Route path="category/:catname" element={<ShopperCategotyComponent />}></Route>
            </Routes>
            <div className="text-end">
                <button onClick={SignOutClick} className="btn btn-danger btn-link mt-5">Sign Out</button>
            </div>
        </div>
    )
}
export default ShopperHomeComponent;
